INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, waterwayaccessfacilities, waterwayaccessinformation, meetingpoint, libraryeventtypes, status, requirements, eventtype, suburb, ward, image, locationifvenueunavailable, communityhall) VALUES ('Discover podcasting', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d177869371', 'Wynnum Library', '2025-01-21T10:30:00+10:00', '2025-01-21T12:00:00+10:00', 'Tuesday, 21 January 2025, 10:30am - 12pm', 'Have you ever listened to a podcast or audiobook, and are curious to know how the technology works? During this session focused on play and experimentation, use the library’s RODECaster Pro equipment to record audio and learn tips for making memorable content. Once you know the basics, you can book the equipment to use in the library for fun projects, from capturing anecdotes, ideas and stories, to recording memories across generations, and much more!
