INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, waterwayaccessfacilities, waterwayaccessinformation, meetingpoint, libraryeventtypes, status, requirements, eventtype, suburb, ward, image, locationifvenueunavailable, communityhall) VALUES ('Nature journaling 12+', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d179051931', 'Downfall Creek Bushland Centre', '2025-01-24T10:00:00+10:00', '2025-01-24T12:00:00+10:00', 'Friday, 24 January 2025, 10am - 12pm', 'Nature journaling is the practice of recording your interactions with nature using sketches, writing, paintings, poetry, species lists, numbers, graphs, cartoons and more. Environment centre staff will guide you through some fun, simple exercises at this introductory session. Nature journaling is an easy, relaxing practice and encourages mindfulness, hones observation skills, and cultivates a sense of wonder. Close observation and recording of the natural world can be a wonderful form of meditative expression, and provides an opportunity for stillness, reflection, and mindful connection with nature.
