INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, waterwayaccessfacilities, waterwayaccessinformation, meetingpoint, libraryeventtypes, status, requirements, eventtype, suburb, ward, image, locationifvenueunavailable, communityhall) VALUES ('Journey to the Stars', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d179295314', 'Sir Thomas Brisbane Planetarium, Mt Coot-tha', '2025-01-25T12:00:00+10:00', '2025-01-25T12:45:00+10:00', 'Saturday, 25 January 2025, 12 - 12:45pm', 'This dazzling space show launches visitors through space and time to experience the life and death of the stars in our night sky, including our own nurturing Sun. Tour familiar stellar formations, explore new celestial mysteries, and discover the fascinating, unfolding story that connects us all to the stars. Those who come along for the journey may never see the night sky in the same way again. Narrated by Whoopi Goldberg, Session concludes with a virtual tour of the Brisbane night sky.
