INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, waterwayaccessfacilities, waterwayaccessinformation, meetingpoint, libraryeventtypes, status, requirements, eventtype, suburb, ward, image, locationifvenueunavailable, communityhall) VALUES ('Introduction to the media conversion station', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d178573904', 'Carindale Library', '2025-01-31T10:00:00+10:00', '2025-01-31T11:00:00+10:00', 'Friday, 31 January 2025, 10 - 11am', 'Are you interested in converting your photographs, videos, cassettes, film negatives, slides or floppy disks into digital files? Join this session to find out more about Carindale Library’s media conversion station, including an overview of the equipment, some opportunities for hands-on learning and information about how to book a self-service session to begin your digitisation project. Start converting your precious memories into digital files, ready for viewing and sharing!
