INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, waterwayaccessfacilities, waterwayaccessinformation, meetingpoint, libraryeventtypes, status, requirements, eventtype, suburb, ward, image, locationifvenueunavailable, communityhall) VALUES ('BrisAsia 2025: Maal – Connection through the senses', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d179386166', 'Garden City Library', '2025-02-02T10:30:00+10:00', '2025-02-02T11:30:00+10:00', 'Sunday, 2 February 2025, 10:30 - 11:30am', 'Experience Maal (One Spirit), an enchanting workshop celebrating Asian and Indigenous Australian cultures. This interactive session features the talents of Indian-fusion singer Menaka, Japanese Koto master Takako Haggarty and Indigenous artist Glenn Barry. Designed for all ages and abilities, this inclusive program invites you to explore music, movement and storytelling. Ideal for all ages.', 'Library events', 'Aboriginal and Torres Strait Islander,Culture,Free,Music', 'BrisAsia 2025', NULL, 'Free', 'https://www.trumba.com/i/DgA1pKdSWO%2A936b2sQ9ILUsy.jpg', NULL, 'Bookings required. Phone Garden City Library on 07 3403 7745 to reserve your place', NULL, NULL, 'Garden City Library', 'Garden City Library, Westfield Mt Gravatt, Level R4, corner of Logan Road and Kessels Road, Upper Mount Gravatt', 'Library', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
