INSERT INTO events (subject, web_link, location, start_datetime, end_datetime, formatteddatetime, description, event_template, event_type, parentevent, primaryeventtype, cost, eventimage, age, bookings, bookingsrequired, agerange, venue, venueaddress, venuetype, maximumparticipantcapacity, activitytype, waterwayaccessfacilities, waterwayaccessinformation, meetingpoint, libraryeventtypes, status, requirements, eventtype, suburb, ward, image, locationifvenueunavailable, communityhall) VALUES ('Children’s storytime in the park - Wynnum Wading Pool Park, Wynnum', 'https://www.brisbane.qld.gov.au/trumba?trumbaEmbed=view%3devent%26eventid%3d179279710', 'Wynnum Wading Pool Park, Wynnum', '2025-02-05T09:30:00+10:00', '2025-02-05T10:00:00+10:00', 'Wednesday, 5 February 2025, 9:30 - 10am', 'Experience the magic of storytime with your child during a First 5 Forever storytime session in the park at the Pop-up Library. This interactive session includes stories and songs for young children. Ideal for children from birth to five years and their parents or carers.
