The Hội Chợ Tết (Lunar New Year Festival) is the largest cultural celebration of the Vietnamese community, marking the beginning of the Lunar New Year and the arrival of Spring in the Northern Hemisphere.

Over two vibrant days, enjoy a festive atmosphere with activities for the whole family, including traditional Vietnamese cuisine from food stalls, information booths, lion dances, firecrackers, fireworks, and performances by local musicians and artists. The festival also features a traditional costume parade, martial arts demonstrations, calligraphy displays, folk games, and a special photo booth to capture unforgettable moments, along with a fun-ride area for children.

