Bush Kindy can go for up to 45 minutes and will go ahead in light rain. Themes vary each week.

On the day Arrive 10 minutes before starting time to check in with staff at the centre. All children must be accompanied and directly supervised by an adult. Wear a hat, fully enclosed shoes, sun-smart clothing, sunscreen, and bring insect repellent. Bring water and a snack if required as there are no food outlets on site. It is recommended to bring a spare change of clothes as sessions may include messy play.Note: This event will go ahead in light rain. Events are subject to weather and environmental conditions and may be cancelled on the day.', 'Brisbane City Council', 'Family events,Free,Green', 'Bush Kindy', 'Family events', 'Free', 'https://www.trumba.com/i/DgDT4p7WZ7TNVb4nsDXSbXLB.jpg', 'Suitable for ages 3-5 years', 'Bookings required via <a href="https://www.eventbrite.com.au/e/bush-kindy-tickets-1073862043279" target="_blank">Eventbrite</a>.

