For as long as humans have inhabited the Earth, we have depended on wetlands for our survival. These ecosystems are among the planet''s most vital, teeming with biodiversity and brimming with life, from the grandest landscapes to the tiniest microorganisms. Join Mike Ronan and Gary Cranitch as they take you on a journey through the creation of the richly illustrated Wetlands of Queensland – A Queensland Museum Discovery Guide and their journey since the book was published.

Mike Ronan, Manager of the Wetlands Program at Department of the Environment, Tourism, Science and Innovation meticulously propelled this project to life undertaking research, logistics and content for the book.

Gary Cranitch, a wilderness photographer with over 42 years of experience, will share his extensive collection of photographs capturing the rare, remote, and beautiful Queensland Wetlands. He will recount his experiences of traversing the landscape to photograph rivers, swamps, and lakes in both drought and flood conditions and the ongoing journey since the book was published.', 'Brisbane City Council', 'Art,Exhibitions,Free,Green', NULL, 'Green', 'Free', 'https://www.trumba.com/i/DgCcX65TmCv6NBP8WIE1AtLy.jpg', 'Suitable for ages 8+', 'No bookings required.', TRUE, 'Kids,Teens,Young adults,Adults (30+),Seniors', 'Boondall Wetlands Environment Centre', 'Boondall Wetlands Environment Centre, 31 Paperbark Drive (entry via Stanworth Rd), Boondall', 'Park', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);

